                    "on success, result is `Ok` and the result from the interior call, if it was executed,",
                    "may be found in the deposited `MultisigExecuted` event.",
                    "",
                    "# <weight>",
                    "- `O(S + Z + Call)`.",
                    "- Up to one balance-reserve or unreserve operation.",
