                    "Only `T::RejectOrigin` is able to cancel a bounty.",
                    "",
                    "- `bounty_id`: Bounty ID to cancel.",
                    "",
                    "# <weight>",
                    "- O(1).",
                    "# </weight>"
                  ]
                },
                {
                  "name": "extend_bounty_expiry",
